package com.br.contactfetchapp.data.source.remote.apiimport retrofit2.Responseimport retrofit2.http.GETimport retrofit2.http.Queryimport com.br.contactfetchapp.data.source.remote.response.RandomUserResponseinterface RandomUserApi {    @GET("api/")    suspend fun getAllUsers(        @Query("seed") seed: String = "lydia",        @Query("results") results: Int,        @Query("page") page: Int,    ): Response<RandomUserResponse>}